#function that sets initial coordinates when mouse button is pressed
def initial_coordinates(event):
	global x_init, y_init, x_min, y_min, x_max, y_max, time1 

	x0 = event.x
	y0 = event.y
	
	#finding the maximum and minimum coordinates in x and y directions  
	if x0 >= x_max:
		x_max = x0
	if x0 <= x_min:
		x_min = x0
	if y0 >= y_max:
		y_max = y0
	if y0 <= y_min:
		y_min = y0

	#creating dot in the initial coordinates point 
	cv.create_oval(x0-1, y0-1, x0+1, y0+1, fill="black",width=2)
	x_init, y_init = x0, y0

#function that paints (creates many dots) as the mouse button is pressed
def paint(event):
	global x_init, y_init, draw, x_min, y_min, x_max, y_max 
	

	x, y = event.x, event.y 
	#keeping track of the maximum and minimum coordinates
	if x >= x_max:
		x_max = x
	if x <= x_min:
		x_min = x
	if y >= y_max:
		y_max = y
	if y <= y_min:
		y_min = y

	#drawing on the canvas
	cv.create_oval(x-1, y-1, x+1, y+1, fill="black",width=2)
	cv.create_line(x_init, y_init, x, y, fill='black',width=3)

	#drawing on the PIL file (not visible for user)
	draw.ellipse([x-1, y-1, x+1, y+1],fill="black",width=1)
	draw.line([x_init, y_init, x, y],fill="black",width=1)

	x_init, y_init = x, y 

#function is called when the button is released
def isReady(event):
	global x3, y3, image, image1, digital, x_min, y_min, x_max, y_max, time0
	x3 = event.x
	y3 = event.y

	#creating the red frame around drawn object
	cv.create_line(x_min, y_min, x_max, y_min, x_max, y_max, x_min, y_max, x_min, y_min,fill="red")
	
	#keeping track of time when the button is released
	time0 = time.time()

		
def transform(event):
	global k, image, image1, imagelist, draw, digital, x_min, y_min, x_max, y_max, time0

	#if the button is not pressed within 0.4s the transformation statrs
	if (time.time() - time0 > 0.4) and (x_min != 5000):
		
		#creating the border around symbol (for better neural network learing)
		borderx = np.round((x_max-x_min)/5)
		bordery = np.round((y_max-y_min)/5)

		if x_max-x_min < 4:
			borderx = 5
		if y_max-y_min < 4:
			bordery = 5

		#taking the image from the PIL file and resizing it to 20x20 (used for neural network)
		area = (x_min-borderx,y_min-bordery,x_max+borderx,y_max+bordery)
		letter = image1.crop(area)
		letter.save('image2.png')

		letter = letter.resize((20,20))

		#separate code used for creating dataset
			#dataset = PIL.Image.open('symbol_training_set.png')
			#dataset.paste(letter, (20*(k % 100), 20*(k//100)))
			#dataset.save("symbol_training_set.png")

			#k += 1
			#print('k =', k)
		
		#opening the picture of the symbol
		filename = prediction(dataimage(letter)) + '.png'


		#pasting the image of the symbol to the right place on the image and putting this image on canvas
		img_original = Image.open(filename)
		img = img_original.resize((x_max-x_min+2,y_max-y_min+2))
		
		image.paste(img, (x_min-1,y_min-1))

		imagelist.append((x_min,y_min,x_max,y_max))

		digital = ImageTk.PhotoImage(image)
		cv.delete('all')
		cv.create_image(1000, 0, anchor=NE, image=digital) 

		#setting new initial values for min and max coordinates, PIL image1 and drawing on it
		x_min, y_min = 5000,5000  
		x_max, y_max = 0,0
		image1 = PIL.Image.new("RGB", (1000, 750), 'white')
		draw = ImageDraw.Draw(image1)


#function called after pressing new button 
def newPage():
	global image, image1, draw

	#clears the canvas and create several images
	cv.delete('all')
	#image is the final result that contains all symbols
	image = PIL.Image.new("RGB", (1000, 750), 'white')
	#image1 is the image that only has one element and it is used to crop the particular handwritten element
	image1 = PIL.Image.new("RGB", (1000, 750), 'white')
	draw = ImageDraw.Draw(image1)

	#binding all defined functions
	cv.bind('<Button>', initial_coordinates)
	cv.bind('<B1-Motion>', paint)
	cv.bind('<ButtonRelease>', isReady)
	cv.bind('<Motion>', transform)

#undo command that puts blank square on the place of the last drawn element
def undo():
	global image, digital, imagelist

	#finding the coordinates of the last drawn element
	element = imagelist[len(imagelist)-1]
	imagelist = imagelist[0:len(imagelist)-1]

	x_min, y_min, x_max, y_max = element[0], element[1], element[2], element[3]

	img_original = Image.open('empty.png')
	img = img_original.resize((x_max-x_min+2,y_max-y_min+2))
	
	image.paste(img, (x_min-1,y_min-1))

	digital = ImageTk.PhotoImage(image)
	cv.delete('all')
	cv.create_image(1000, 0, anchor=NE, image=digital)


